import { combineReducers } from 'redux';
import { connectRouter } from 'connected-react-router';
import host from './PingP/host';
import gameplay from './PingP/gameplay';
import player from './PingP/player'; //quiz

import quizPlayer from './quiz/player';
import quizHost from './quiz/host'; //general 

import generalHost from './general/host';
import generalPlayer from './general/player';
export default (function (history) {
  return combineReducers({
    router: connectRouter(history),
    //pingp
    player: player,
    gameplay: gameplay,
    host: host,
    //quiz
    quizHost: quizHost,
    quizPlayer: quizPlayer,
    //general
    generalHost: generalHost,
    generalPlayer: generalPlayer
  });
});
